DROP TABLE IF EXISTS `t_audit`;
CREATE TABLE `t_audit` (
  `id` bigint(20) unsigned NOT NULL COMMENT '编号',
  `name` varchar(64) DEFAULT NULL COMMENT '审核项',
  `type` int(1) DEFAULT NULL COMMENT '审核类别 1:单位信息审核 2:项目登记审核 3:项目上交审核 4:成果汇交审核',
  `user_id` bigint(20) unsigned DEFAULT NULL COMMENT '单位用户编号',
  `status` int(1) DEFAULT NULL COMMENT '审核状态 0:通过 1:拒绝',
  `submit_time` datetime DEFAULT NULL COMMENT '提交时间',
  `audit_time` datetime DEFAULT NULL COMMENT '审核时间',
  `memo` varchar(64) DEFAULT '' COMMENT '备注',
  `ref_id` bigint(20) DEFAULT NULL COMMENT '关联业务编号',
  `create_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  KEY `t_audit_ref_id_index` (`ref_id`),
  KEY `t_audit_user_id_index` (`user_id`),
  KEY `t_audit_type_index` (`type`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='审核表';

