-- ----------------------------
-- Table structure for t_mapping_project
-- ----------------------------
DROP TABLE IF EXISTS `t_mapping_project`;
CREATE TABLE `t_mapping_project` (
  `id` bigint(20) unsigned NOT NULL,
  `project_type` varchar(64) DEFAULT '' COMMENT '项目类型',
  `project_name` varchar(128) DEFAULT '' COMMENT '项目名称',
  `project_amount` double DEFAULT NULL COMMENT '项目金额（万元）',
  `project_leader` varchar(32) DEFAULT '' COMMENT '项目负责人',
  `start_date` varchar(100) DEFAULT NULL COMMENT '开工日期',
  `end_date` varchar(100) DEFAULT NULL COMMENT '完工日期',
  `complete_time` varchar(64) DEFAULT '' COMMENT '完成工期',
  `acceptance_department` varchar(255) DEFAULT '' COMMENT '验收机构',
  `acceptance_report` varchar(64) DEFAULT '' COMMENT '验收报告文号',
  `task_source` varchar(64) DEFAULT '' COMMENT '任务来源',
  `project_area` double DEFAULT NULL COMMENT '项目面积（km²）',
  `scale` varchar(128) DEFAULT '' COMMENT '比例尺（开本，册）',
  `sheet_number` varchar(128) DEFAULT '' COMMENT '图幅数量（线路里程）',
  `awards_department` varchar(128) DEFAULT '' COMMENT '颁奖单位',
  `prize_level` varchar(128) DEFAULT '' COMMENT '获奖类型等级',
  `project_quality_approval` varchar(128) DEFAULT '' COMMENT '项目质量认可',
  `winning_time` varchar(100) DEFAULT NULL COMMENT '获奖时间',
  `acceptance_time` varchar(100) DEFAULT NULL COMMENT '验收时间',
  `basic_content` varchar(512) DEFAULT '' COMMENT '基本内容',
  `credit_status` varchar(128) DEFAULT '' COMMENT '履约情况',
  `submit_status` varchar(64) DEFAULT '' COMMENT '向测绘主管部门汇交成果情况',
  `user_id` bigint(20) DEFAULT NULL COMMENT '单位用户编号',
  `schedule` int(11) DEFAULT '0' COMMENT '进度（百分比）',
  `create_time` varchar(100) DEFAULT NULL COMMENT '创建时间',
  `modify_time` varchar(100) DEFAULT NULL COMMENT '更改时间',
  `memo` varchar(256) DEFAULT NULL COMMENT '备注',
  `status` int(1) DEFAULT '2' COMMENT '项目进行状态 2:未完成 3:已完成',
  `audit_status` int(1) DEFAULT '3' COMMENT '项目审核结果 0:通过 1:未通过 2:已提交 3:未提交',
  `results_status` int(1) DEFAULT '3' COMMENT '项目成果汇交状态 0:通过 1:未通过 2:已提交 3:未提交',
  `coordinate` mediumtext COMMENT '坐标',
  `meridian` varchar(60) CHARACTER SET utf8mb4 DEFAULT NULL COMMENT '中央子午线',
  `coordinate_system` varchar(60) CHARACTER SET utf8mb4 DEFAULT NULL COMMENT '坐标系',
  `management_level` varchar(60) DEFAULT '' COMMENT '管理级别',
  `funding_source` varchar(60) DEFAULT '' COMMENT '资金来源',
  `entrust_unit` varchar(60) DEFAULT '' COMMENT '\r\n委托单位',
  `accept_unit` varchar(60) DEFAULT '' COMMENT '\r\n承建单位',
  `mobile_phone` varchar(24) DEFAULT '' COMMENT '手机号码',
  `phone` varchar(24) DEFAULT '' COMMENT '固定\r\n电话',
  `address` varchar(128) DEFAULT '' COMMENT '项目所在地',
  `center_point` varchar(64) DEFAULT '' COMMENT '项目中心点',
  `synchronization_status` int(1) DEFAULT '1' COMMENT '同步状态 0：已同步 1：未同步',
  `contract_time` varchar(100) DEFAULT NULL COMMENT '合同上传时间',
  PRIMARY KEY (`id`),
  KEY `user_id` (`user_id`) USING BTREE,
  KEY `t_mapping_project_results_status_index` (`results_status`),
  KEY `t_mapping_project_audit_status_index` (`audit_status`),
  KEY `t_mapping_project_status_index` (`status`),
  KEY `t_mapping_project_project_type_index` (`project_type`),
  KEY `t_mapping_project_schedule_index` (`schedule`),
  KEY `t_mapping_project_synchronization_status_index` (`synchronization_status`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='测绘项目信息';

