  `school` varchar(48) DEFAULT '' COMMENT '毕业院校',
  `major` varchar(32) DEFAULT '' COMMENT '所学专业',
  `education_background` varchar(24) DEFAULT '' COMMENT '学历',
  `degree` varchar(32) DEFAULT '' COMMENT '学位',
  `special_post` varchar(32) DEFAULT '' COMMENT '特殊岗位',
  `user_id` bigint(20) DEFAULT NULL COMMENT '单位用户编号',
  `create_time` date DEFAULT NULL COMMENT '创建时间',
  `modify_time` date DEFAULT NULL COMMENT '修改时间',
  PRIMARY KEY (`id`),
  KEY `user_id` (`user_id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='特殊岗位人员信息表';

