-- ----------------------------
-- Table structure for t_technicist
-- ----------------------------
DROP TABLE IF EXISTS `t_technicist`;
CREATE TABLE `t_technicist` (
  `id` bigint(20) unsigned NOT NULL COMMENT '编号',
  `name` varchar(32) NOT NULL DEFAULT '' COMMENT '姓名',
  `major_type` varchar(32) NOT NULL DEFAULT '' COMMENT '计入专业技术人员类别',
  `id_type` varchar(32) NOT NULL DEFAULT '' COMMENT '证件类型',
  `id_number` varchar(32) NOT NULL DEFAULT '' COMMENT '证件号码',
  `sex` int(1) DEFAULT '3' COMMENT '性别 0:女 1:男 2:保密',
  `age` int(3) DEFAULT NULL COMMENT '年龄',
  `work_year` int(2) DEFAULT NULL COMMENT '工作年限',
  `duty` varchar(32) DEFAULT NULL COMMENT '职务',
  `title` varchar(32) DEFAULT '' COMMENT '职称',
  `school` varchar(32) DEFAULT '' COMMENT '毕业院校',
  `graduation_date` date DEFAULT NULL COMMENT '毕业时间',
  `degree` varchar(32) DEFAULT '' COMMENT '学位',
  `education_background` varchar(24) DEFAULT '' COMMENT '学历',
  `major` varchar(32) DEFAULT '' COMMENT '所学专业',
  `title_major` varchar(32) DEFAULT '' COMMENT '职称专业',
  `start_time` date DEFAULT NULL COMMENT '进入本单位时间',
  `title_time` date DEFAULT NULL COMMENT '任职时间(获得职称时间)',
  `start_contract` date DEFAULT NULL COMMENT '聘用或劳动合同开始时间',
  `end_contract` date DEFAULT NULL COMMENT '聘用或劳动合同终止时间',
  `post` varchar(32) DEFAULT '' COMMENT '现从事工作',
  `mapping_year` int(2) DEFAULT NULL COMMENT '从事测绘工作年限',
  `special_post` varchar(32) DEFAULT '' COMMENT '特殊岗位',
  `affirm` varchar(32) DEFAULT NULL COMMENT '认定',
  `user_id` bigint(20) DEFAULT NULL COMMENT '单位用户编号',
  `create_time` date DEFAULT NULL COMMENT '创建时间',
  `modify_time` date DEFAULT NULL COMMENT '修改时间',
  PRIMARY KEY (`id`),
  KEY `user_id` (`user_id`) USING BTREE,
  KEY `t_technicist_major_type_index` (`major_type`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='技术人员信息表';

