INSERT INTO `t_mapping_unit` VALUES ('1205018991207120896', '2019-12-12', '2020-01-19', '', '阳江市勘察测绘院', '阳江市西平路80号', '1975-08-15', '阳江市西平路80号', '梁鑑', '姜宜恺', '江城区', '1800000.000', '144170000021', '乙级', '0662-3292073', '办公电话', '可承担工程测量包括控制测量、地形测量、规划测量、建筑工程测量、变形形变与精密测量、市政工程测量、线路与桥隧测量、地下管线测量、矿山测量；不动产测绘包括地籍测绘、房产测绘、行政区域界线测绘', '阳江市勘察测绘院最早成立于1975年，原名阳江县建委测量队；1989年9月在原基础上成立阳江市测量队。并于2004年7月更名为阳江市勘察测绘院（批准文号阳机编[2004]55号)，2010年与阳江市房地产测绘所合并,沿用阳江市勘察测绘院名称；隶属于阳江市住房和城乡规划建设局,为经营服务性事业位。持有广东省建设厅颁发的工程勘察（工程测量专业）乙级证书及广东省国土资源厅颁发的乙级“测绘资格证书”资质。我院主要为城市规划、建设、管理提供测绘技术和各种测绘资料。现有职工62人，其中具有高中级技术职称的14人，初级技术职称20人。主要设备有GPS接收机、全站器，水准仪，管线探仪、手持测距仪、电脑、打印机、扫描仪等仪器设备。 近年来，我院经强化内部管理，进一步完善质量保证体系，测绘事业有了长足的发展。在市区建立了完善的测量控制系统并在规划控制区进行了大面积地形测绘，经济效益和社会效益有了较大的提高。', '阳江市测量队', '111.96020', '21.86086', '529500', '529500', '660.000', '1975-08-16', '13926380386', '0662-3251713', '191080196@qq.com', '33', '67', '事业单位', '勘察', '乙测资字4410441 ', '2019-12-31', '', '', '', null, '', '阳江市自然资源局', '', null, '', '12441700457062930T', '', '25', '0', '{\"type\":\"FeatureCollection\",\"features\":[{\"id\":\"1d4279ad32860b25928464bd60a94812\",\"type\":\"Feature\",\"properties\":{},\"geometry\":{\"coordinates\":[111.95955982608308,21.876102484983434],\"type\":\"Point\"}}]}', '12441700457062930T', '1', '0', '102', null);
INSERT INTO `t_mapping_unit` VALUES ('1205019055635824640', '2019-12-12', '2019-12-13', '', '阳江市华纳土地房地产资产评估有限公司', '阳江市江城区创业路35号四层、六层', '2000-12-19', '阳江市江城区创业路35号四层、六层', '吴泳良', '谢策记', '江城区', '3000000.000', '91441700725981540', '乙级', '0662-3313283', '13702677578', '工程测量：控制控制、地形测量、规划测量、建筑工程测量、市政工程测量、水利工程测量、线路与桥隧测量、矿山测量；不动产测绘；地籍测绘、房产测绘，行政区域界线测绘；海洋测绘；海域权属测绘、海岸地形测量、水深测量、水文规划。', ' 阳江市华纳土地房地产资产评估有限公司，于2000年12月23日从本市国土系统脱钩改制成立，现办公地址设在阳江市江城区创业路35号华纳中心。本公司的主要业务范围对应的资质有：\n1、 评估类：土地评估资质（二级）、房地产评估资质（二级）、资产评估资质（全国范围执业）；\n2、 测绘类：土地登记代理、不动产测绘（地籍测绘、房产测绘）、工程测量、海洋测绘、林权调查、林权测绘；\n3、 工程咨询类：编制项目建议书、编制项目可行性研究报告、节能评估报告、社会稳定风险评估报告、项目申请报告、资金申请报告、工程项目管理（全过程咨询）。\n4、 规划类：国土空间规划、生态评估、生态保护修复文案编制、土地利用总体规划、土地整治规划、耕地保护规划、土地利用专项规划、城乡规划、建设项目用地预审、用地组卷代理报批、林业调查规划设计、林业调查采伐设计等。\n本公司拥有一批高素质的专业技术人员，是一家由土地估价师、房地产估价师、资产评估师、工程咨询师、会计师、经济师、测绘师、林业工程师、规划师、高级工程师等中高级专业技术人员组成的综合性咨询服务机构。本公司现有员工70人，其中9人具有土地估价师执业职业资格，9人具有房地产估价师执业职业资格，6人具有资产评估师执业职业资格、土地登记代理人4人，工程咨询师6人，测绘工程师8人，市政、建筑、规划类工程师8人，高级工程师4人。本公司的专业技术人员大部分毕业于或来自于国土、住建、财税等部门或相对应的专业。他们多年从事土地评估、房地产评估、资产评估、林业规划设计、工程咨询、测绘和规划等工作，熟悉国家的各项专业法律法规，具有丰富的从业经历。\n   本公司自2000年 12月23日成立至今，已历经19个年头的发展。至目前，本公司是阳江市评估行业首家同时在阳江市区、阳春市、阳西县、阳东区设有分公司，并购置了办公场所，配备有完善的管理、技术人员架构、办公设备、业务车辆的评估公司。本公司也是阳江市评估行业首家实施评估行业“3H”服务营销方案的评估公司。本公司已建立并覆盖对阳江市范围内各县、市、区的基准地价、基准房价体系，并坚持每年度根据各县、市、区地价、房价的市场波动情况进行及时的调整和完善。在政府基础评估工作中，本公司于2010年承担并完成阳春市区、阳春各乡镇的基准地价制定工作，得到阳春市政府、省国土厅的认可并备案。于2017年承担阳东区国有农用地基准地价的制定工作，并入选阳江市政府关于土地招、拍、挂地价领导小组三家专家成员单位之一。本公司坚持按照土地评估协会、房地产评估协会、资产评估协会、测绘协会、工程咨询协会、规划协会、林业协会及相关监管部门的要求，在公司内部实行严格的评估体系三审制度，严格把关评估价格市场公允性、评估报告出具的严谨性。本公司目前与阳江市法院系统、阳江市自然资源系统、住建系统、财税系统、发改系统、农业系统、市政系统、林业系统、交通系统等职能部门保持有良好的工作关系及工作沟通，且已与阳江市中级人民法院对拍卖评估业务展开业务合作，及与中国工商银行阳江市分行、中国建设银行阳江市分行、中国银行阳江市分行、中国农业银行阳江市分行、中国邮政银行阳江市分行、广发银行阳江市分行、中国农业发展银行阳江市分行、阳春农商银行、阳西农信社、海陵农信社、阳东农商行、阳江农商行等金融机构开展评估业务合作。本公司也是阳江市评估行业首家同时具有评估类资质、测绘类资质、规划类资质、工程咨询类资质等各业务领域的资质的综合型评估公司。在测绘业务方面，本公司也是阳江市测绘行业首家拥有航拍无人机及掌握相关航拍技术的测绘单位。本公司也是阳江市评估行业首家在各县、市、区不动产登记中心开展不动产权属调查、权籍测绘的评估公司。至目前，本公司已成功在市不动产登记中心、阳春不动产登记中心、阳西不动产登记中心，阳东不动产登记中心、海陵不动产登记中心开展不动产权籍调查业务。\n     本公司将本着“3H”营销服务体系精神，秉承“服务无限、创造无限”的服务宗旨，竭诚为每一个客户，提供在服务、效率、技术等各方面最优质的服务。', '', null, null, '', '', null, null, '', '', '', null, null, '', '', '', null, '', '', '', null, '', '', '', null, '', '', '', '26', '1', '{\"type\":\"FeatureCollection\",\"features\":[{\"id\":\"5f7d09d5a22abc6defaaadc32526f45c\",\"type\":\"Feature\",\"properties\":{},\"geometry\":{\"coordinates\":[112.01797214427609,21.86022213134062],\"type\":\"Point\"}},{\"id\":\"37d98669740fb1aaaf28ea07825a35a1\",\"type\":\"Feature\",\"properties\":{},\"geometry\":{\"coordinates\":[111.97714967734794,21.87223354853299],\"type\":\"Point\"}}]}', '', '3', '0', '100', null);
INSERT INTO `t_mapping_unit` VALUES ('1205019101123051520', '2019-12-12', '2020-01-18', '', '阳江市正德设计咨询有限公司', '阳江市江城区上坑路22号外贸大厦七楼', '2009-05-20', '阳江市江城区上坑路22号外贸大厦七楼', '梁修略', '刘丽金', '江城区', '1010000.000', '91441702688655936M', '丙级', '0662-3209138', '13537994322', '工程测量:控制测量、地形测量、水利工程测量、规划测量、建筑工程测量、市政工程测量、变形形变与精密测量、线路与桥隧测量、矿山测量;不动产测绘：地籍测绘、房产测绘;', '阳江市正德设计咨询有限公司于2009年5月注册，现有注册资金101万元。现拥有测绘资质丙级证书，各类技术人员23人，其中测绘专业技术人员9人，拥有先进的测绘仪器设备和各类测绘应用软件。单位办公面积380 平方米。 公司拟承接工程测量,地籍测绘等业务，日常主要以工程测量为主。 公司按照有关法律和文件的精神，建立了完善的质量管理制度和标准。我司本着“正德厚生，臻于至善”的企业宗旨，不断完善各项制度，加强质量管理，以优质的服务，赢得了信誉。我司将以热情饱满的服务态度、诚实守信的职业道德、精益求精的质量意识、客观严谨的工作作风竭诚为社会各界服务。', '', null, null, '', '', null, null, '13537994322', '0662-3209138', '', '9', '33', '', '', '丙测资字4422235 ', '2015-08-31', '有限责任公司', '', '', null, '', '', '', null, '', '', '', '27', '0', '{\"type\":\"FeatureCollection\",\"features\":[{\"id\":\"a0febb6b0690db663559309d8970ccd3\",\"type\":\"Feature\",\"properties\":{},\"geometry\":{\"coordinates\":[111.9656315997745,21.85839351202597],\"type\":\"Point\"}}]}', '', '3', '0', '100', null);
INSERT INTO `t_mapping_unit` VALUES ('1205019132425142272', '2019-12-12', '2019-12-18', '', '阳春市建设测量队', '阳春市春城城云路10号', '1997-11-10', '阳春市春城街道人防大厦', '林铁', '林铁', '阳春市', '1050000.000', '12441781197535067C', '丙级', '0662-7716525', '13829882366', '工程测量：控制测量（四等以下。）、地形测量（1：500比例尺，15km2以下；1：1000比例尺，20km2以下；1：2000比例尺，30km2  以下；小于1：5000比例尺，60km2以下。）、规划测量（总建筑面积30万m2以下；国家重点建设工程不得承担。） 建筑工程测量（30层以下的住宅、高度70m以下的非住宅性质的民用建筑。）、变形形变与精密测量（不得承担精密工程测量。建筑面积在2万m2以下且高度在50m以下的建筑。不得承担铁路、高速公路的 桥隧及城市轨道交通项目。）、市政工程测量（大中等城市一般道路、小城市道路。）矿山测量（矿区控制面积100km2以下。）', '　　　阳春市建设测量队成立于1995年10月，属阳春市住房和城乡规划建设局直属的事业单位，现有在编干部职工12人，其中工程师5人，助理工程师3人。仪器设备有测地型GPS接收机3台，全站仪3台，水准仪2台，手持测距仪6台；电脑8台及其它一批测量配套设施。1996年经省国土厅审批，获得丙级《测绘资格证书》。\n　　　测量队成立以来，主要工作有：1、为阳春市住房和城乡规划建设局办理《建设用地规划许可证》提供办证1/500地形图；2、为阳春市住房和城乡规划建设局审批的《建设工程规划许可证》实施规划放线；3、为阳春市住房和城乡规划建设局提供小面积规划设计所需的1/500地形图；4、完成阳春市政府、阳春市住房和城乡规划建设局局布置的所有市政工程的测量、放线工作；5、完成少量其它小面积1/500地形测量工作。\n　　　测量队在实施各项测量过程中，严格执行国家统一的《城市测量规范》、《工程测量规范》、《全球定位系统GPS测量规范》等技术规范和质量标准，测绘成果实行二级检查一级验收制度；为阳春市城市规划、建设、管理提供了有力的保障。', '', null, null, '', '', null, null, '13829882366', '', '', null, null, '', '', '', null, '', '', '', null, '', '', '', null, '', '', '', '28', '3', '{\"type\":\"FeatureCollection\",\"features\":[{\"id\":\"8ad6956d37aba301670cfd63e57d9c59\",\"type\":\"Feature\",\"properties\":{},\"geometry\":{\"coordinates\":[111.77682889008884,22.180652673303257],\"type\":\"Point\"}}]}', '', '3', '0', '100', null);
