INSERT INTO `t_mapping_unit` VALUES ('1205019196212117504', '2019-12-12', null, '', '阳东县测量队', '', null, '', '', '', '阳东区', null, '', '丙级', '', '', null, null, '', null, null, '', '', null, null, '', '', '', null, null, '', '', '', null, '', '', '', null, '', '', '', null, '', '', '', '30', '3', null, '', '3', '0', '100', null);
INSERT INTO `t_mapping_unit` VALUES ('1205019228650864640', '2019-12-12', '2020-01-19', '', '阳江市水利水电勘测设计有限公司', '阳江市江城区体东路37号7楼', '2006-10-12', '阳江市江城区体东路37号7楼', '谭逢记', '谭莎莎', '江城区', '3000000.000', '914417007946397020', '丙级', '0662-3328311', '18934128709', '水利、水电和工程测量、工程造价预算、水文地质、岩土工程的编建议书、编可研报告、 工程设计、水土保持方案编制、防洪评价、水资源论证、招标咨询、管理咨询（投产后）； 市政（防洪、给排水、库区、路、桥）的编建议书、编可研报告、工程设计、工程监理、 管理咨询（投产后）；销售：建筑安装材料、工程勘测设计测量仪器、办公耗材、软件。   工程测量：控制测量(四等以下。)、地形测量(1：500比例尺，15平方公里以下；1：1000比例尺，20平方公里以下；1：2000比例尺，30平方公里以下；小于1：5000比例尺，60平方公里以下。)、规划测量(总建筑面积30万平方米以下；国家重点建设工程不得承担。)、建筑工程测量(30层以下的住宅、高度70m以下的非住宅性质的民用建筑。)、市政工程测量(大中等城市一般道路、小城市道路。)、水利工程测量(中型、小型水利水电工程。)、线路与桥隧测量(200km以下的线路，多孔跨径总长在30m以下的桥梁，3km以下的隧道。不得承担铁路、高速公路的桥隧及城市轨道交通项目。)、矿山测量(矿区控制面积100平方公里以下。)。', '阳江市水利水电勘测设计有限公司成立于2006年，持有水利工程设计丙级、水土保持方案\n编制水平评价3星、水资源论证乙级、工程测量丙级。公司主要承担水利水电工程、规划、\n水资源开发利用、水土保持方案编制、小型水电站、防洪排涝、农村供水、机电排灌等工程\n的设计、咨询、测量等工作。 ', '无', '111.98', '21.87', '529500', '529500', '250.000', null, '18934128709', '0662266976', '', '8', '20', '私营企业', '水利行业', '丙测资字4423057', '2018-03-29', '有限责任公司', '', '', null, '', '', '', null, '', '', '', '31', '0', '{\"type\":\"FeatureCollection\",\"features\":[{\"id\":\"c05d9361eb940e67c2715b6a48de69b1\",\"type\":\"Feature\",\"properties\":{},\"geometry\":{\"coordinates\":[111.95173040455495,21.866835235463242],\"type\":\"Point\"}}]}', '', '3', '0', '100', null);
INSERT INTO `t_mapping_unit` VALUES ('1205019260171059200', '2019-12-12', '2020-03-16', '', '阳江市永烽测绘有限公司', '阳江市江城区九眼塘路20号', '2019-04-29', '阳西县兴业路1号粤丰广场B306号铺', '张高玮', '张高玮', '阳西县', '15000000.000', '91441721MA4W977R7G', '丁级', '0662-5889898', '15626350440', '不动产测绘；地籍测绘；工程测量；市场营销策划；商贸信息咨询服务；物业管理；房地产销售；无人机植保技术服务。', null, '', null, null, '', '', null, null, '', '', '', null, null, '', '', '', null, '', '', '', null, '', '', '', null, '', '', '', '32', '1', null, '', '3', '0', '100', null);
INSERT INTO `t_mapping_unit` VALUES ('1205019285974417408', '2019-12-12', '2020-01-19', '', '阳西县经纬勘测有限公司', '阳西县织篢镇黎昌㙟留用地（B44）号地', '2018-07-29', '阳西县织篢镇黎昌㙟留用地（B44）号地', '冯德业', '林进婷', '阳西县', '1000000.000', '91441721MA4X5HXN63', '丁级', '0662-5530046', '15099828985', '工程测量、控制测量、地形测量、规划测量、建筑工程测量、市政工程测量；不动产测绘、地籍测绘、房产测绘。', '阳西县经纬勘测有限公司成立于2017年9月22日，是由自然人发起成立的专门从事测绘工作有限责任公司。公司位于阳西县兴业路粤丰广场大门口对面自建房（行政服务中心斜对面），公司管理制度健全，公司技术人员精通控制测量、地形测量、规划测量、建筑工程测量、市政工程测量、地籍测量、房产测绘等测绘业务，具有熟练的操作技能，熟悉国家及省有关测绘规定。 公司目前拥有全站仪2台、水准仪1台、手持测距仪3台、RTK3台、无人机1台等测量仪器设备。有相关测量软件，如cass90、 ArcGIS、房测之友BMF等。 本公司可以承揽工程测量（控制测量、地形测量、规划测量、建筑工程测量、市政工程测量、线路与桥隧测量、矿山测量；）不动产测绘（地籍测绘、房产测绘；）海洋测绘（海域权属测绘）等业务。品牌印证着品质，理想激励着创造力。我们将继往开来，不断创新，为社会各界提供优质和高效的服务。', '', null, null, '', '529800', '69.600', '2017-09-22', '15089577226', '', '592131895@qq.com', '8', '5', '私营企业', '测绘地理信息', '丁测资字4433128', '2018-02-12', '', '', '', null, '', '', '', null, '', '91441721MA4X5HXN63', '', '33', '0', '{\"type\":\"FeatureCollection\",\"features\":[{\"id\":\"028df58f2657e580211fe45b02babdf0\",\"type\":\"Feature\",\"properties\":{},\"geometry\":{\"coordinates\":[111.61132884764959,21.752876266675344],\"type\":\"Point\"}}]}', '', '3', '0', '100', null);
INSERT INTO `t_mapping_unit` VALUES ('1205019329481932800', '2019-12-12', '2020-03-23', '', '阳江市江城区广信勘测有限公司', '阳江市江城区康泰路96号之一二楼', '2017-11-28', '阳江市江城区康泰路96号之一二楼', '邓朝阔', '周霞', '江城区', '500000.000', '91441700MA512M3W95', '丁级', '0662-3265838', '18666238227', ' 工程测量:控制测量(等级以外。)、地形测量(1: 500比例尺，10平方公里以下;1: 1000比例尺，15平方公里以下;1: 2000比例尺，20平方公里以下。)、规划测量(总建筑面积20万平方米以下;国家重点建设工程不得承担。)、建筑工程测量(7层以下的住宅、高度24m以下的非住宅性质的民用建筑。)、市政工程测量(局部市政工程。);不动产测绘:地籍测绘(日常地籍调查及乡镇级以下地籍总调查中的地籍测绘。)、房产测绘(规划许可证载单栋建筑面积2万平方米以下;单个合同标的不超过建筑面积50万平方米。)', '    阳江市江城区广信勘测有限公司成立于2017年11月28日，办公地址位于阳江市江城区康泰路96号之一二楼，注册资金50万元人民币，公司现有测绘专业技术人员3人，相关专业人员1人；其中中级技术人员1人，初级技术人员3人。目前拥有技术先进的中海达iRTK2两台、拓普康GTS1002N全站仪(2″)两台、水准仪1台、手持测距仪3台等测量仪器设备。有相关测量软件，如cass90、ArcGIS等软件。\n    公司秉承“严谨求实、优质高效、诚信至上”的服务宗旨，发扬“团结、严谨、务实、创新”的企业精神，坚持“以质量争信誉、以技术求发展、以管理创效益”的经营理念，立足阳江地区，致力于为地方城市建设、新农村建设提供一流的测绘服务和解决方案。', '', null, null, '529500', '529500', '52.000', '2017-11-28', '18666238227', '0662-3265838', '710833389@qq.com', '4', '4', '私营企业', '工程测量', '丁测资字 4430248', '2019-04-20', '有限责任公司', '', '', null, '', '', '丁级', '2019-04-20', '', '91441700MA512M3W95', '有限责任公司', '34', '2', '{\"type\":\"FeatureCollection\",\"features\":[{\"id\":\"e1cd0288a441c8b1b5a3bafc18352dbc\",\"type\":\"Feature\",\"properties\":{},\"geometry\":{\"coordinates\":[111.95772261143662,21.866078729986413],\"type\":\"Point\"}},{\"id\":\"e030502bc3ca2652c5fb7620e07abfa3\",\"type\":\"Feature\",\"properties\":{},\"geometry\":{\"coordinates\":[111.97203195969712,21.895048471678166],\"type\":\"Point\"}}]}', '', '3', '0', '100', null);
INSERT INTO `t_mapping_unit` VALUES ('1205019357705404416', '2019-12-12', '2019-12-14', '', '阳春市漠阳测绘技术有限公司', '阳春市春城街道东兴中街48号', '2018-07-02', '阳春市春城街道东兴中街48号', '梁宗会', '梁宗会', '阳春市', '550000.000', '91441781MA51Y32H2F', '乙级', '0662-6169068', '', '工程测量：控制测量、地形测量、规划测量、建筑工程测量、市政工程测量、矿山测量。 不动产测绘；地籍测绘、房产测绘。', '阳春市漠阳测绘技术有限公司成立于2018年7月，属股份制公司企业，现有员工7人，其中级工程师1人，助理工程师3人。仪器设备有全站仪2台，水准仪1台，手持测距仪3台；电脑及其它一批测量配套设施。2018年经阳江市国土资源局审批，获得丁级《测绘资格证书》；　　　公司成立以来，主要工作有：1、为客户办理《建设用地规划许可证》提供办证1/500地形图；2、为客户办理不动产权证提供房产测绘分户图。', '', null, null, '', '', null, null, '', '', '', null, null, '', '', '', null, '', '', '', null, '', '', '', null, '', '', '', '35', '0', '{\"type\":\"FeatureCollection\",\"features\":[{\"id\":\"cacd0d5b09b57d0a7e68a3a2eb65462b\",\"type\":\"Feature\",\"properties\":{},\"geometry\":{\"coordinates\":[111.78754161627023,22.17915299448896],\"type\":\"Point\"}}]}', '', '3', '1', '100', null);
INSERT INTO `t_mapping_unit` VALUES ('1205019388822945792', '2019-12-12', '2020-01-19', '', '阳江市立德隆测绘有限公司', '阳江阳西', '2018-07-04', '广东省阳江市阳西县兴业路1号粤丰广场B215号铺', '陈德玮', '冯立本', '阳西县', '5000000.000', '91441721MA51Y69G7E', '丁级', '0662-5558811', '15820368666', '地籍测绘；房产测绘；林业调查规划设计；控制测量；地形测量；规划测量；建筑工程测量；市政工程测量；线路与桥隧测量；地下管线测量；矿山测量；测绘技术咨询服务。', '阳江市立德隆测绘有限公司于2018年07月在阳江市阳西县工商行政管理局登记成立，注册资本：人民币伍佰万元。公司住所：阳西县兴业路1号粤丰广场B215号铺，经营范围：工程测量、不动产测绘、地籍测绘等。\n为满足公司健康有序地发展，公司设有档案部、工程部、财务部，均有专职人员负责。公司还不断吸收优秀的管理和专业技术人才，同时不断完善各项管理制度。\n未来，我们充满信心！公司将竭诚提供满意的服务。', '', null, null, '529800', '529800', '53.820', '2018-07-04', '', '', '', '10', '13', '', '专业技术服务业', '丁测资字4433459', '2019-06-06', '有限责任公司（自然人独资）', '', '', null, '', '阳西县自然资源局', '丁级', '2018-10-31', '', '91441721MA51Y69G7E', '', '36', '0', null, '', '3', '0', '100', null);
