INSERT INTO `t_mapping_unit` VALUES ('1205019465247358976', '2019-12-12', '2020-01-19', '', '阳江市江城区卓越测绘有限公司', '阳江市江城区康泰路国际会展中心', '2018-07-29', '阳江市江城区石湾北路富地花园3幢7号', '陈聪颖', '陈聪颖', '江城区', '600000.000', '91441700MA522PY2XJ', '丁级', '', '13902884416', '工程测量：控制测量(等级以外。)、地形测量(1：500比例尺，10平方公里以下；1：1000比例尺，15平方公里以下；1：2000比例尺，20平方公里以下。)、规划测量(总建筑面积20万平方米以下；国家重点建设工程不得承担。)、建筑工程测量(7层以下的住宅、高度24m以下的非住宅性质的民用建筑。)、市政工程测量(局部市政工程)。不动产测绘：地籍测绘(日常地籍调查及乡镇级以下地籍总调查中的地籍测绘)、房产测绘(规划许可证载单栋建筑面积2万平方米以下；单个合同标的不超过建筑面积50万平方米。', '我公司成立于2018年7月30日，属于有限责任公司，注册资金六十万元人民币。目前拥有职工人数共计4人，其中测绘专业技术人员4人，相关专业人员0人，其中中级技术人员1人，初级技术人员3人。我公司将严格遵守国家测绘相关法规和相关技术规程，致力于为地方建设提供测绘服务。公司目前拥有中海达华星RTK（A12）两台、中海达华星全站仪HTS-221RH4两台、水准仪1台、手持测距仪3台等测量仪器设备，有相关测量软件，如cass90、ArcGIS等。', '', null, null, '', '', null, '2018-07-29', '13902884416', '', '', null, null, '', '', '', null, '', '', '', null, '', '', '', null, '', '', '', '38', '2', '{\"type\":\"FeatureCollection\",\"features\":[{\"id\":\"125f485f412a234496d600ed1e6a84b6\",\"type\":\"Feature\",\"properties\":{},\"geometry\":{\"coordinates\":[111.96538361960933,21.893496848924528],\"type\":\"Point\"}}]}', '', '3', '0', '100', null);
