INSERT INTO `t_mapping_unit` VALUES ('1205019520742195200', '2019-12-12', '2019-12-19', '', '阳江市住房和城乡规划建设局海陵分局勘察测绘所', '阳江市住房和城乡规划建设局海陵分局办公大楼', '2011-10-28', '海陵公局办公楼', '陈号开', '陈月赛', '江城区', '20000.000', '12441700592165967G', '丁级', '0662-3890063', '15875157939', '丁级：工程测量：控制测量、地形测量、规划测量、建筑工程测量、市政工程测量；不动产测绘：地籍测绘、房产测绘。', '我单位于2011年10月28日经阳江市机构编制委员会批准成立，现有中级工程师两名，初次工程师两名，初级技术人一名，全站仪两台，S3水准仪一台，手持测距仪3台，电脑6台，复印机等仪器一批。主要负责阳江市海陵岛区内基础测绘，行政区域界线测绘，地籍测绘，控制测量，房产测绘等任务。', '', null, null, '', '', null, null, '', '', '', null, null, '', '', '', null, '', '', '', null, '', '', '', null, '', '', '', '40', '3', '{\"type\":\"FeatureCollection\",\"features\":[{\"id\":\"e47a9a6ee0269ed41915cd7cc29e151d\",\"type\":\"Feature\",\"properties\":{},\"geometry\":{\"coordinates\":[111.84502775480888,21.57590245677595],\"type\":\"Point\"}}]}', '', '3', '1', '100', null);
