INSERT INTO `t_mapping_unit` VALUES ('1205019572646707200', '2019-12-12', '2020-01-19', '', '阳西县全方测绘有限公司', '阳西县县城教育中路47号二楼', '2014-01-21', '阳西县县城教育中路47号二楼', '文方民', '文方民', '阳西县', '500000.000', '91441721091785236T', '丁级', '06625522165', '15113541980', '丁级：工程测量：地形测量(1：500比例尺，10平方公里以下；1：1000比例尺，15平方公里以下；1：2000比例尺，20平方公里以下。)、市政工程测量(局部市政工程。)；不动产测绘：房产测绘(规划许可证载单栋建筑面积2万平方米以下；单个合同标的不超过建筑面积50万平方米。)、地籍测绘(日常地籍调查及乡镇级以下地籍总调查中的地籍测绘。)。', '我公司成立于2014年01月21日，全称：阳西县全方测绘有限公司，属于有限责任公司。我公司目前拥有职工人数共计4人，其中测绘专业技术人员为3人，相关专业人员1人。测绘专业技术人员中1人为中级工程师， 3人为测量工。拥有测绘仪器：全站仪两台、水准仪一台、手持测距仪3台。', '', null, null, '', '', '120.000', null, '', '', '', '8', '15', '私营企业', '测绘', '丁测资质4431303', '2015-05-26', '企业', '', '/', null, '/', '阳西县自然资源局测绘信息股', '丁级', null, '', '', '', '42', '3', '{\"type\":\"FeatureCollection\",\"features\":[{\"id\":\"4aa22849c7b61b6413ea745a7ef726db\",\"type\":\"Feature\",\"properties\":{},\"geometry\":{\"coordinates\":[111.61096645617351,21.757201333128776],\"type\":\"Point\"}}]}', '', '3', '1', '100', null);
