INSERT INTO `t_mapping_unit` VALUES ('1218724172578947072', '2020-01-19', '2020-01-19', '', '深圳市勘察研究院有限公司', '深圳市福田区福中东路15号', '2018-07-31', '阳江市江城区九眼塘路20号', '梁守宏', '张志晓', '深圳', '101000000.000', '914403001921810441', '甲级', '18344200186', '18344200186', '一、工程勘察（1、岩土工程勘察；2、水文地质勘察；3、工程测量。）二、建设工程质量检测（地基基础工程检测，主体结构工程检测；建筑幕墙检测；钢结构工程检测）', null, '', null, null, '', '929500', '61.500', null, '18344200186', '', '624373584@qq.com', '4', '8', '私人企业', '测量', '甲测资字4400271', '2018-07-31', '企业', '', '', null, '', '', '', null, '', '914403001921810441', '', '57', '0', null, '', '3', '0', '100', null);
INSERT INTO `t_mapping_unit` VALUES ('1218733525222555648', '2020-01-19', '2020-01-19', '', '中山市测绘工程有限公司', '中山市石岐区兴中道6号2幢309-316号', '2002-07-16', '阳江市江城区华美二街锦绣 名城10号商铺', '陈清华', '李颜丽', '中山', '5000000.000', '9144200045726476X3', '甲级', '0760-88220869', '13590790090', '测绘', '        中山市测绘工程有限公司是专门从事工程测量、大地测量、不动产测绘、地理信息系统工程、摄影测量与遥感等工作的专业化测绘公司，具有国家甲级测绘资质。\n        公司具有一批测绘地理信息行业资深专家和充满活力的专业团队，拥有现代化的测绘装备，如徕卡TS50i高精度全站仪、徕卡DNA03精密水准仪、GPS接收机及网络版数字化地形地籍测绘软件系统，自主开发的网络版房产测绘软件系统，公司具有完整的工程测量、大地测量、不动产测绘、地理信息系统工程、摄影测量与遥感测绘生产能力。\n        多年来，公司持续推行 ISO9001质量管理体系、OHSMS18001职业健康安全管理体系、ISO14001环境管理体系，各项工作一直在规范化、系统化轨道上运行，长期坚持“管理科学，产品优良，专业高效，顾客满意”的服务宗旨，赢得了良好的社会信誉。\n        公司具有强大的土地调查专业技术力量，承担过中山市第三次全国国土调查、中山市第二次全国土地调查、中山市地籍调查等基础性工作，并承担了中山市第一个成片“三旧”改造（西区马山片区）测绘任务，长期的土地房产调查测绘工作积累了丰富的经验。\n', '', '113.39653415', '22.52735686', '528400', '', '1200.000', null, '13590790090', '0760-88220979', '49715345@qqco', '71', '86', '有限责任公司', '', '甲测资字4400587', '2016-06-21', '有限责任公司', '', '', null, '', '', '', null, '', '9144200045726476X3', '', '58', '2', null, '', '3', '1', '100', null);
INSERT INTO `t_mapping_unit` VALUES ('1218886846671486976', '2020-01-19', '2020-01-22', '', '广州全成多维信息技术有限公司阳江分公司', '阳江', '2018-11-22', '阳江市江城区石湾路东马曹路北小区20号二楼', '谭通明', '谭博文', '广州', null, '91441700MA52JB5892', '甲级', '13542636238', '', '地理信息系统工程、工程测量、不动产测绘、大地测量、测绘航空摄影、摄影测量与遥感、海洋测绘', '公司坚持 “人才为根、诚信为本、品高兴业、合作共赢、稳固发展” 的经营理念，始终奉承 “诚信、团结、吃苦、进取、创新” 的企业精神，贯彻落实 “客户没有想到的，我们要想到做到；客户想到了的，我们要做到更好” 的企业要求，执着地追求 “用我们的心工作，让客户的心放下，树立《测绘地理信息业》标杆\" 的企业梦想。', '', null, null, '529500', '529500', '50.000', null, '13542636238', '', '947702889@qq.com', '5', '8', '私营', '测绘', '4400541', '2017-07-17', '私营', '', '', null, '', '', '甲级', null, '', '91441700MA52JB5892', '', '60', '2', null, '', '3', '1', '100', null);
